import InviteTrainee from '../pages/InviteTrainee';
import VideoCard from './VideoCard';
import React, { useEffect, useState } from 'react';
import TrainerHeader from './TrainerHeader';
import './Dashboard.css';
// เพิ่มสไตล์ธีมม่วงแบบหน้า trainee
const themePurple = {
  background: 'linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%)',
  minHeight: '100vh',
  fontFamily: 'Inter, sans-serif',
};

const TrainerDashboard = () => {
  const [videos, setVideos] = useState([]);
  const [summary, setSummary] = useState(null);
  const [traineeReport, setTraineeReport] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');
  const [profile, setProfile] = useState({ name: '', email: '', picture: '' });

  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoading(true);
    // ดึง user จาก localStorage (เหมือน trainee)
    const userData = localStorage.getItem('user');
    let userPic = '';
    let userName = '';
    if (userData) {
      try {
        const userObj = JSON.parse(userData);
        userPic = userObj.picture || '';
        userName = userObj.name || '';
      } catch {}
    }
    // Fetch all trainers (เลือก trainer ที่ email ตรงกับ user ที่ login)
    fetch('http://localhost:8000/trainers', {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => res.json())
      .then(trainers => {
        let trainer = null;
        if (Array.isArray(trainers) && trainers.length > 0) {
          if (userData) {
            try {
              const userObj = JSON.parse(userData);
              trainer = trainers.find(t => t.email === userObj.email) || trainers[0];
            } catch {
              trainer = trainers[0];
            }
          } else {
            trainer = trainers[0];
          }
        }
        if (trainer) {
          setProfile({
            name: userName || trainer.name,
            email: trainer.email,
            picture: userPic || '/user (1).png'
          });
          // Fetch trainer profile for more details
          fetch(`http://localhost:8000/trainers/${trainer.id}`, {
            headers: { Authorization: `Bearer ${token}` }
          })
            .then(res => res.json())
            .then(profileData => {
              // Simulate summary and report from profileData
              setSummary({
                most_popular_title: 'N/A',
                most_popular_count: 0,
                total_usage: 0
              });
              setTraineeReport([]); // No trainee report in backend yet
              setVideos([]); // No videos endpoint in backend yet
            })
            .catch(() => setError('เกิดข้อผิดพลาดในการโหลดข้อมูลโปรไฟล์เทรนเนอร์'))
            .finally(() => setIsLoading(false));
        } else {
          setError('ไม่พบข้อมูลเทรนเนอร์');
          setIsLoading(false);
        }
      })
      .catch(() => {
        setError('เกิดข้อผิดพลาดในการโหลดข้อมูลเทรนเนอร์');
        setIsLoading(false);
      });
  }, []);

  if (isLoading) return <div className="dashboard-loading"><div className="loading-spinner"></div><p>กำลังโหลดข้อมูล...</p></div>;
  if (error) return <div className="error-message">{error}</div>;

  // mock data แบบ trainee
  const mockVideos = [
    { id: 1, title: 'Pushups', image: 'https://images.pexels.com/photos/2261482/pexels-photo-2261482.jpeg', duration: '30.20', kcal: 20, score: 95, statusBtn: 'Active' },
    { id: 2, title: 'Pushups', image: 'https://images.pexels.com/photos/2261482/pexels-photo-2261482.jpeg', duration: '30.20', kcal: 20, score: 95, statusBtn: 'Active' },
    { id: 3, title: 'Pushups', image: 'https://images.pexels.com/photos/2261482/pexels-photo-2261482.jpeg', duration: '30.20', kcal: 20, score: 95, statusBtn: 'Active' },
    { id: 4, title: 'Pushups', image: 'https://images.pexels.com/photos/2261482/pexels-photo-2261482.jpeg', duration: '30.20', kcal: 20, score: 95, statusBtn: 'Active' },
  ];
  return (
    <div className="dashboard trainer-dashboard-bg" style={themePurple}>
      {/* Header (TrainerHeader ไม่มี pts) */}
      <TrainerHeader
        user={{
          name: profile.name,
          picture: profile.picture || '/user (1).png',
        }}
        date={new Date().toLocaleDateString('en-GB', { day: 'numeric', month: 'long', year: 'numeric' })}
      />
      <div style={{
        background: '#f3f4f6',
        borderRadius: 20,
        boxShadow: '0 2px 24px rgba(0,0,0,0.10)',
        maxWidth: 1200,
        margin: '2rem auto',
        padding: '2.2rem 2.2rem 2.5rem 2.2rem',
        minHeight: 800,
        display: 'flex',
        flexDirection: 'column',
        gap: 32,
        border: '1.5px solid #e5e7eb'
      }}>
        {/* Layout: Memberlist + Videolist */}
        <div style={{display:'flex',gap:40,alignItems:'flex-start',padding:'0'}}>
          {/* Memberlist */}
          <aside style={{background:'#fff',borderRadius:20,padding:'2rem 1.5rem',boxShadow:'0 2px 16px rgba(0,0,0,0.06)',minWidth:320,maxWidth:340,flex:'0 0 320px',display:'flex',flexDirection:'column',gap:18}}>
            {/* Trainer info (avatar + name) */}
            <div style={{display:'flex',alignItems:'center',gap:16,marginBottom:8}}>
              <img src={profile.picture} alt="avatar" style={{width:54,height:54,borderRadius:'50%',objectFit:'cover',border:'2.5px solid #e5e7eb'}} />
              <div style={{fontWeight:800,fontSize:'1.25rem',color:'#23272e',lineHeight:1.1}}>{profile.name}</div>
              <span style={{width:13,height:13,borderRadius:'50%',background:'#22c55e',display:'inline-block',marginLeft:8}}></span>
            </div>
            <hr style={{border:'none',borderTop:'1.5px solid #e5e7eb',margin:'0 0 14px 0'}} />
            <div style={{fontWeight:700,fontSize:'1.08rem',marginBottom:8}}>Memberlist (12)</div>
            <div style={{display:'flex',gap:8,marginBottom:14}}>
              <input type="email" placeholder="Type an email to invite" style={{flex:1,padding:'0.55rem 1.1rem',borderRadius:16,border:'1px solid #e5e7eb',fontSize:'1rem',background:'#f8fafc'}} />
              <button style={{background:'linear-gradient(90deg,#ff4d8b 0%, #a855f7 100%)',color:'#fff',fontWeight:700,border:'none',borderRadius:16,padding:'0.5rem 1.2rem',fontSize:'1rem',display:'flex',alignItems:'center',gap:6,cursor:'pointer',boxShadow:'0 2px 8px -2px #a855f733'}}>
                <span style={{fontSize:'1.2rem',marginRight:2}}>+</span> Invite
              </button>
            </div>
            {/* Member avatars list (mockup) */}
            <div style={{flex:1,overflowY:'auto',maxHeight:420}}>
              {[...Array(8)].map((_,i)=>(
                <div key={i} style={{display:'flex',alignItems:'center',gap:12,marginBottom:12}}>
                  <img src={i%2===0 ? 'https://randomuser.me/api/portraits/men/32.jpg' : 'https://randomuser.me/api/portraits/men/31.jpg'} alt="avatar" style={{width:36,height:36,borderRadius:'50%',objectFit:'cover',border:'2px solid #e5e7eb'}} />
                  <div style={{fontWeight:600,fontSize:'1rem'}}>Plume FitAddict</div>
                  <span style={{width:10,height:10,borderRadius:'50%',background:'#22c55e',display:'inline-block',marginLeft:'auto',marginRight:8}}></span>
                  <span style={{fontSize:22,color:'#64748b',cursor:'pointer'}}>⋮</span>
                </div>
              ))}
            </div>
          </aside>
          {/* Videolist */}
          <main style={{flex:1}}>
            <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:18}}>
              <div style={{fontWeight:700,fontSize:'1.18rem'}}>Videolist (4)</div>
              <button style={{background:'linear-gradient(90deg,#ff4d8b 0%, #a855f7 100%)',color:'#fff',fontWeight:700,border:'none',borderRadius:16,padding:'0.5rem 1.2rem',fontSize:'1rem',display:'flex',alignItems:'center',gap:7,cursor:'pointer',boxShadow:'0 2px 8px -2px #a855f733'}}>
                <img src={process.env.PUBLIC_URL + '/UploadSimple.png'} alt="upload" style={{width:20,height:20,marginRight:6,verticalAlign:'middle'}} /> Upload
              </button>
            </div>
            {/* Video cards */}
            <div style={{display:'grid',gridTemplateColumns:'repeat(auto-fit,minmax(290px,1fr))',gap:22}}>
              {mockVideos.map(v => <VideoCard key={v.id} video={v} />)}
            </div>
            <div style={{display:'flex',justifyContent:'flex-end',marginTop:18}}>
              <button style={{background:'#f3f4f6',color:'#64748b',fontWeight:700,border:'none',borderRadius:12,padding:'0.5rem 1.5rem',fontSize:'1rem',boxShadow:'0 2px 8px -2px #a855f722',marginRight:2,cursor:'pointer'}}>More</button>
            </div>
          </main>
        </div>
      </div>
    </div>
  );
}

export default TrainerDashboard;
